import React, { useState } from "react";
import '../CSS/Nav1.css';
import { NavLink } from 'react-router-dom';
import logo from '../Images/logo-crop.png'

const Nav1 = () => {
    const [showNav,setNav] = useState(false);
    return (
        <>
            <nav>
                <div className="navigation">
                    <div className="left_nav">
                        <img src={logo} className="logo_img" />
                        <ul className="list">
                            <li><NavLink className='nav-link' to='/'>Home</NavLink></li>
                            <li><NavLink className='nav-link' to='/generate'>Generate</NavLink></li>
                            <li><NavLink className='nav-link' to='/pricing'>Pricing</NavLink></li>
                        </ul>
                    </div>
                    <div className="right_nav">
                        <div className="circle"></div>
                        <div className='menu-bar' onClick={()=>{setNav(!showNav)}}>{!showNav?<i class="fa-solid fa-ellipsis-vertical nav-menu"></i>:<i class="fa-solid fa-ellipsis-vertical" style="color: #214ea6;"></i>}</div>
                    </div>
                </div>
            </nav>
        </>
    )
}
export default Nav1;
